    false,nt"url": null,nt"notes": "Rugosity is derived from gridded (5 m cell
    size) bathymetry from two sources: Multibeam bathymetry collected by Coral Reef
    Ecosystem Division aboard NOAA R/V AHI, and NOAA Ship Hi'ialakai; multibeam bathymetry
    collected aboard the US Naval Ship Sumner by the Naval Oceanographic Office, and
    lidar, also collected by the Naval Oceanographic Office. Rugosity is derived using
    the Benthic Terrain Modeler with rugosity methods by Jeff Jenness (2003). Cell values
    reflect the (surface area) / (planimetric area) ratio for the area contained within
    that cell's boundaries. They provide indices of topographic roughness & convolutedness.
    This data set is for Saipan Islands, Commonwealth of the Northern Marianas (CNMI).",nt"license_title":
